import React from "react";
import {
    StyleSheet, 
    View,
} from  "react-native";
import {
    Text, 
    Card, 
    Button, 
    Paragraph, 
    Title, 
    Avatar, 
    List,
} from "react-native-paper";

export default function UnlockPremium(props) {
    const LeftContent = props => <Avatar.Icon {...props} icon="folder" />
    return (
        <View style={styles.container}>
            <View>
                <Card>
                    <Card.Cover source={{ uri: 'https://picsum.photos/700' }} />
                    <Card.Content>
                        <Title style={{marginTop: 16}}>Unlock Premium</Title>
                        <List.Section>
                            <List.Item 
                                title="First Item" 
                                left={() => <List.Icon icon="folder" />} 
                            />
                            <List.Item
                                title="Second Item"
                                left={() => <List.Icon color="#000" icon="folder" />}
                            />                  
                        </List.Section>
                    </Card.Content>
                    <Card.Actions>
                        <Button>Cancel</Button>
                        <Button>Ok</Button>
                    </Card.Actions>
                </Card>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    container: { 
        backgroundColor: "#121212",
        paddingTop: 16,
        paddingBottom: 16,
        paddingLeft: 16,
        paddingRight: 16,
        flex: 1
    },
});
